Invocation Chain/Thread Analysis Data Server


Invocation chain/thread handlers in HM analyze and process the invocation chain/thread analysis data in RocketMQ and stores the data in Elasticsearch;
HM supports the query interfaces http://ip:port/jta/q,http://ip:port/ivc/q, and http://ip:port/slw/q for front-end display in AppHub.

