moniorframework.html.body:
Monitor Framework
MOF Architecture
MOF Architecutre Components

Core Components:
Supporter, CaptureFramework, InteceptFramework, HookFactory, ProfileFramework and DataObserver
Component Illustration:

Supporter: an abstract feature support class which represents a feature and can be dynamically loaded;
CaptureFramework: a monitoring data capture framework tha supports the fetching of monitoring data;
InterceptFramework: AOP's implementation framework which supports aspect expansion;
ProfileFramework: captures the profile data and listens to event hooking (profile listener);
HookProxy: a hook framework of application codes; 
DataObserver: exposes the data capturing interface (JMX/HTTP) to Monitor Agent;
